import logo from './logo.svg';
import './App.css';

function Smth1(props){
  return 
    <p>{props.children}</p>;

}

function App() {
  const h = <h2>asd</h2>
  return (
      <Smth1 cos={h}>
        <h2>1</h2>
        <h2>2</h2>
        <h2>3</h2>
      </Smth1>
  );
}

export default App;
